import React, {Component} from 'react';
import {Link, Route, BrowserRouter, HashRouter} from "react-router-dom";
import Login from './Login'
import './menubar_css.css'
class Menubar extends Component{
    render(){
      return(
        <>

        <div className="Wrapper">
        <a className="name" href="#"><h2>동아리 모두 모아</h2></a>
        <div className="login">
         <Login></Login>
        </div>
        </div>
        <HashRouter>
        <nav class="nav nav-pills flex-column flex-sm-row">
        <a class="flex-sm-fill text-sm-center nav-link"><Link activeClassName="navbar__active" to="/">메인페이지</Link></a>
        <a class="flex-sm-fill text-sm-center nav-link"><Link to="/Search">동아리 보기</Link></a>
        <a class="flex-sm-fill text-sm-center nav-link" ><Link to="/Register">동아리 신청</Link></a>
        <a class="flex-sm-fill text-sm-center nav-link" ><Link to="/mypage">마이페이지</Link></a>
      </nav>
      </HashRouter>
      </>
      );
      }
    }

export default Menubar;
